webpackJsonp([0x99c22d1d7f00],{7839:function(e,t){e.exports={data:{post:{html:'<p>Seeing as we have a <a href="http://www.papascott.de/archives/2007/03/27/bricks-and-mortar/">need for cash</a> in the next couple of months, MamaMaus exercised some of her stock options last night at $46.45.</p>\n<p><a href="http://biz.yahoo.com/ap/070409/mcdonald_s_executive_compensation.html">Unlike Jim</a>, she doesn\'t have to disclose her income or stock transactions. I mention this only as a public service to our readers, since we are notoriously bad at timing stock transactions. Sure, we sold on the day of a 7-year high, but <a href="http://finance.yahoo.com/q?s=MCD">MCD</a> is probably going to take off like a rocket now.</p>',fields:{title:"Dreams for Sale: $46.45",date:"10 Apr 2007",url:"https://papascott.de/2007-04-10-dreams-for-sale-4645/"}}},pathContext:{slug:"/2007-04-10-dreams-for-sale-4645/",prev:{fields:{title:"Minicruise Photo Set",date:"09 Apr 2007",slug:"/2007-04-09-minicruise-photo-set/"}},next:{fields:{title:"Coffee and the German Banking System",date:"13 Apr 2007",slug:"/2007-04-13-coffee-and-the-german-banking-system/"}}}}}});
